import React, {useContext, useState} from 'react';
import {Link} from 'react-router-dom';


import { 
  Container,
  HeaderDiv,
  Logo,
  UserNameLink,
  BodyDiv,
  MenuDiv,
  BtnMenuHome,
  BtnMenuAgenda,
  // BtnMenuRedeCredenciada,
  BtnMenuConsulta,
  BtnMenuSair,
  List,
  ListItens

} from './styles';
import AuthContext from '../../../contexts/Auth'


import logo from '../../../assets/Image/Logo_Dashboard.png'


export default function Rede_Credenciada() {
  const { user } = useContext(AuthContext);
  const [dados, setDados] = useState([
    {
      id: 1,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    }
  ])


  return(
    <Container>
      <HeaderDiv>
        <Link to={"/dashboard_Paciente"} >
          <Logo src={logo} />
        </Link>
        <UserNameLink href={"/"}>{user.nome}</UserNameLink>
      </HeaderDiv>

      <BodyDiv>
        <MenuDiv>
            <Link to={"/dashboard_Paciente"}>Home</Link>
            <br/>
            <Link to={"/"}>Agendas</Link>
            <br/>
            <Link to={"/rede_Credenciada"}>Rede Credenciada</Link>
            <br/>
            <Link to={"/"}>Agendar Consulta</Link>
            <br/>
            <Link to={"/signin"}>Sair</Link>
        </MenuDiv>
        <ListItens>
        {
            dados.map(function(data){
              return(
                <ul key={data.id} >
                  <li>{data.medico}</li>
                </ul>
              )
            })
          }
        </ListItens>



      </BodyDiv>

    </Container>
  );
}
